import { Card,Image } from 'semantic-ui-react';
import React, { Component }  from 'react';
var Papa = require("papaparse");
var csv = require('jquery-csv');

execBoard = [
  {name:"Wyatt Focht",graduation:2023,title:"Director of Technology and Communications",email:"wgf6@duke.edu",fact:"Pussy",image:"wyattfocht.png"}
]




export default class ExecutiveBoard extends Component {
OFFICERS_FILE = './Officers.csv';
IMAGES_PATH = '../data/images/';
execBoardCards = [];

constructor(props){
    super();
    this.createCards();
}
  individualCard(name,graduation,title,email,fact,image){



    return(
    <Card>
        <Image src={image} wrapped ui={false} />
        <Card.Content>
        <Card.Header>{name}</Card.Header>
        <Card.Meta>
            <span className='graduation'>Class of {graduation}</span>
        </Card.Meta>
        <Card.Description>
            {title} <br></br>
            {email} <br></br>
            {fact}<br></br>
        </Card.Description>
        </Card.Content>
    </Card>
    )
}

    createCards(){
        var execBoard = Papa.parse(new File(this.OFFICERS_FILE), {
            header: true
        });

        console.log(execBoard);
        for (var i = 0; i < execBoard.length; i++){
                this.execBoardCards[i] = this.individualCard(execBoard.name,execBoard.graduation,execBoard.title,execBoard.email,execBoard.fact,this.IMAGES_PATH+execBoard.image);
        }





 }
    render(){
        return(
            this.execBoardCards
        ) 
    }
}
